description:
These are LuaJIT 2.0.0 binaries for Windows.

The binaries have been built from LuaJIT git HEAD (commit 8b46013 on February 3, 2013 at 12:47:52 GMT+0100) using MS Visual Studio 2005 with /DLUAJIT_ENABLE_LUA52COMPAT option (see http://luajit.org/extensions.html#lua52).

----------------
Latest LuaJIT binaries for Windows are available at &lt;a href=&quot;
http://luajit4win.no-ip.org&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
